// src/App.jsx
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import ResumePage from './pages/ResumePage';
import ResumePreviewPage from './pages/ResumePreviewPage';
import CompanyExplorer from './components/CompanyExplorer';
import RoadmapPage from './pages/RoadmapPage';
import InterviewPage from './pages/InterviewPage';

function App() {
  return (
    <Router>
      <div className="min-h-screen flex flex-col font-sans bg-white text-neutral-800">
        {/* Navbar */}
        <header className="bg-[#002b5c] text-white shadow sticky top-0 z-50">
          <div className="max-w-7xl mx-auto px-4 py-4 flex justify-between items-center">
            <h1 className="text-xl font-bold tracking-wide">CareerLaunch</h1>
            <nav className="space-x-6 text-sm font-medium">
              <Link to="/" className="hover:text-yellow-400">üè† Home</Link>
              <Link to="/resume" className="hover:text-yellow-400">üìù Resume</Link>
              <Link to="/roadmap" className="hover:text-yellow-400">üìö Roadmap</Link>
              <Link to="/interview" className="hover:text-yellow-400">üíº Interview</Link>
              <Link to="/companies" className="hover:text-yellow-400">üè¢ Companies</Link>
            </nav>
          </div>
        </header>

        {/* Page Content */}
        <main className="flex-grow max-w-7xl mx-auto px-4 py-8">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/resume" element={<ResumePage />} />
            <Route path="/resume/preview" element={<ResumePreviewPage />} />
            <Route path="/roadmap" element={<RoadmapPage />} />
            <Route path="/interview" element={<InterviewPage />} />
            <Route path="/companies" element={<CompanyExplorer />} />
          </Routes>
        </main>

        {/* Footer */}
        <footer className="bg-[#f5f5f5] py-4 text-center text-sm text-gray-600">
          ¬© 2025 CareerLaunch. All rights reserved.
        </footer>
      </div>
    </Router>
  );
}

function Home() {
  return (
    <section className="text-center mt-20">
      <h2 className="text-3xl font-bold text-[#002b5c]">üöÄ Welcome to CareerLaunch</h2>
      <p className="text-gray-600 mt-4 text-lg">Your Ultimate Guide for Placement Preparation</p>
    </section>
  );
}

export default App;
